(1, 31, 'Md Fahim', 'Fahim MIT', 'fahimmit05@gmail.com', 'Software', 'Hi Fahim MIT,\r\n\r\nHope you are doing great. \r\n\r\nWe are writing to request a letter of recommendation from you regarding the time you spent working with Md Fahim. \r\n\r\nIf you can find the time to write a recommendation and can speak about his skills and expertise, we would greatly appreciate the recommendation. \r\n\r\nThank you again for all your help. \r\n\r\nRegards Talenxo Inc.', 'A testimonial is effectively a review or recommendation from a client, letting other people know how your products or services benefitted them. Customer testimonials can take multiple forms, but the goal is always the same: to showcase how great your brand is', '1674985466SlA9oOPlQ4', 1, '2023-01-29 15:44:26', '2023-01-29 15:45:22');
