(99, 4, NULL, 1, NULL, '<p><strong>Questions 1- 3</strong><br />\r\nThree men (Tom, Peter, and Jack) and three women (Eliza, Anne, and Karen) are spending a few<br />\r\nmonths at a hillside. They are to stay in a row of nine cottages, each one living in his or her own<br />\r\ncottage. There are no others staying in the same row of houses.<br />\r\n<em>&nbsp;Anne, Tom, and Jack do not want to stay in any cottage, which is at the end of the row.</em><br />\r\n<em>Eliza and Anne are unwilling to stay besides any occupied cottage.</em><br />\r\n<em>Karen is next to Peter and Jack.</em><br />\r\n<em>Between Anne and Jack&rsquo;s cottage, there is just one vacant house.</em><br />\r\n<em>None of the girls occupy adjacent cottages.</em><br />\r\n<em>The house occupied by Tom is next to an end cottage.</em></p>', 'Which of the above statements can be said to have been derived from two other statements?', NULL, '5', 5, 5, 1, '1628928887e5GQH', '', '2021-08-14 21:14:47', '2021-08-14 21:14:48'),
(100, 4, NULL, 1, NULL, '<p><strong>Questions 1- 3</strong><br />\r\nThree men (Tom, Peter, and Jack) and three women (Eliza, Anne, and Karen) are spending a few<br />\r\nmonths at a hillside. They are to stay in a row of nine cottages, each one living in his or her own<br />\r\ncottage. There are no others staying in the same row of houses.<br />\r\n<em>¬†Anne, Tom, and Jack do not want to stay in any cottage, which is at the end of the row.</em><br />\r\n<em>Eliza and Anne are unwilling to stay besides any occupied cottage.</em><br />\r\n<em>Karen is next to Peter and Jack.</em><br />\r\n<em>Between Anne and Jack‚Äôs cottage, there is just one vacant house.</em><br />\r\n<em>None of the girls occupy adjacent cottages.</em><br />\r\n<em>The house occupied by Tom is next to an end cottage.</em></p>', 'How many of them occupy cottages next to a vacant cottage?', NULL, '4', 5, 5, 1, '16289288884aYFx', '', '2021-08-14 21:14:48', '2021-08-14 21:14:48'),
(101, 4, NULL, 1, NULL, '<p><strong>Questions 1- 3</strong><br />\r\nThree men (Tom, Peter, and Jack) and three women (Eliza, Anne, and Karen) are spending a few<br />\r\nmonths at a hillside. They are to stay in a row of nine cottages, each one living in his or her own<br />\r\ncottage. There are no others staying in the same row of houses.<br />\r\n<em>¬†Anne, Tom, and Jack do not want to stay in any cottage, which is at the end of the row.</em><br />\r\n<em>Eliza and Anne are unwilling to stay besides any occupied cottage.</em><br />\r\n<em>Karen is next to Peter and Jack.</em><br />\r\n<em>Between Anne and Jack‚Äôs cottage, there is just one vacant house.</em><br />\r\n<em>None of the girls occupy adjacent cottages.</em><br />\r\n<em>The house occupied by Tom is next to an end cottage.</em></p>', 'Which among these statement(s) are true?\r\nI.Anne is between Eliza and Jack.\r\nII.At the most four persons can have occupied cottages on either side of them. .\r\nIII.Tom stays besides Peter.', NULL, '2', 5, 5, 1, '1628928889piyij', '', '2021-08-14 21:14:49', '2021-08-14 21:14:49'),
(102, 4, NULL, 1, NULL, '<p>1. The microbe A causes the contagious disease A.<br />\r\n2. The first symptoms appear after a period of two days since the microbe A enters the body.<br />\r\n3. The microbe A is found in some flies and bees.<br />\r\n4. A fly bit Jack on Monday, February 6.<br />\r\n5. Nick worked with Jack the next day, Tuesday, February 7.<br />\r\nThere were no other possibilities of exposure to Disease A.</p>', 'In case Jack showed symptoms of Disease A, which of the following statements would be\r\ntrue?\r\nI. Jack contracted the Disease A from Nick.\r\nII. Jack first noticed symptoms of Disease A on February 8.\r\nIII. The fly that Jack was bitten by was not a carrier of the microbe A.', NULL, '5', 5, 3, 1, '1628929597pv5B6', '', '2021-08-14 21:26:37', '2021-08-14 21:26:37'),
