(104, 4, NULL, 1, NULL, '<p>1. The microbe A causes the contagious disease A.<br />\r\n2. The first symptoms appear after a period of two days since the microbe A enters the body.<br />\r\n3. The microbe A is found in some flies and bees.<br />\r\n4. A fly bit Jack on Monday, February 6.<br />\r\n5. Nick worked with Jack the next day, Tuesday, February 7.<br />\r\nThere were no other possibilities of exposure to Disease A.</p>', 'In case Jack displayed symptoms of Disease A, which would be true?\r\nI.Jack was also bitten by a fly on February 5.\r\nII.Jack was bitten by a mosquito which carried the microbe A.\r\nIII.Nick contracted Disease A from Jack.', NULL, '3', 5, 3, 1, '1628929597AjRD1', '', '2021-08-14 21:26:37', '2021-08-14 21:26:37'),
(105, 4, NULL, 1, NULL, '<p>1. The microbe A causes the contagious disease A.<br />\r\n2. The first symptoms appear after a period of two days since the microbe A enters the body.<br />\r\n3. The microbe A is found in some flies and bees.<br />\r\n4. A fly bit Jack on Monday, February 6.<br />\r\n5. Nick worked with Jack the next day, Tuesday, February 7.<br />\r\nThere were no other possibilities of exposure to Disease A.</p>', 'In case Nick displayed the symptoms of Disease A which would be true?\r\nI.Nick was bitten by a bee on February 6.\r\nII.Nick ate food that contained the microbe A.\r\nIII.Nick also worked with Jack on February 6.', NULL, '5', 5, 3, 1, '1628929597O6qjF', '', '2021-08-14 21:26:37', '2021-08-14 21:26:38'),
