(263, 4, NULL, 1, NULL, '<p><strong>The story of silk</strong><br />\r\nThe history of the world‚Äôs most luxurious fabric, from ancient China to the present day<br />\r\nSilk is a fine, smooth material produced from the cocoons ‚Äì soft protective shells- that are made by Mulberry silkworms (Insect larvae). Listen has it that it was Lei Tzu, Wife of the yellow emperor, ruler of China in about 3000 BC, Who discovered silkworms. One account of the story goes that as she was taking a walk in her husband\'s gardens, she discovered that silkworms were responsible for the destruction of several Mulberry trees. She collected a number of cocoons and set down to have a rest. It just so happened that while she was sipping some tea, one of the cocoons that she had collected landed in the hot tea and started to unravel into a fine thread. Lei Tzu found that she could wind this thread around her fingers. Subsequently, she persuaded her husband to allow her to rear silkworms on a grove of Mulberry trees. She also devised a special reel to draw the fibres from the cocoon into a single thread so that they would be strong enough to be woven into fabric. While it is unknown just how much of this is true, it is certainly known that silk cultivation has existed in China for several millennia.<br />\r\nOriginally, silkworm farming was solely restricted to women, and it was they who were responsible for the growing, harvesting and weaving. Silk quickly grew into a symbol of status, and originally, only royalty were entitled to have clothes made of silk. The rules were gradually relaxed over the years until finally during the Qing Dynasty (1644-1911 AD), even peasants, the lowest caste, were also entitled to wear silk. Sometime during the Han dynasty (206 BC ‚Äì 220 AD), Silk was so priced that it was also used as a unit of currency. Government officials were paid their salary in silk, and farmers paid their taxes in grain and silk. Silk was also used as diplomatic gifts by emperor. Fish