e Europe‚Äôs leader in silk production and export. ¬†Venetian merchants traded extensively in silk and encouraged silk growers to settle in Italy. Even now, silk processed in the province of Como in northern Italy enjoys an esteemed reputation.<br />\r\nThe 19th century and industrialization saw the downfall of the European silk industry. Cheaper Japanese silk, trading which was greatly facilitated by the opening of the Suez Canal, was one of the many factors driving the trend. Then in the 20th century, new manmade fibres, such as nylon, started to be used in what had traditionally been silk products, such as stockings and parachutes. The two world wars, which interrupted the supply of raw material from Japan, also stifled the European silk industry. After the Second World War, Japan‚Äôs silk production was restored, with improved production and quality of raw silk. Japan was to remain the world‚Äôs biggest producer of raw silk, and practically the only major exporter of raw silk, until the 1970s. However, in more recent decades, China has gradually recaptured its position as the world\'s biggest producer and exporter of raw silk and silk yarn. Today, around 125,000 metric tons of silk are produced in the world, and almost 2/3 of that production takes place in China.</p>', '20th century: ............ and other manmade fibres cause decline in silk production', NULL, '1', 1, 1, 1, '1629627526yfB2b', '', '2021-08-22 23:18:46', '2021-08-22 23:18:46'),
