(292, 4, NULL, 1, NULL, '<p><strong>Suppose you are given a table/relation &ldquo;EMPLOYEE&rdquo; which has two columns (&lsquo;Name&rsquo; and &lsquo;Salary&rsquo;). The Salary column in this table has some NULL values. Now, I want to find out the records which have null values.</strong></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Name</td>\r\n			<td>Salary</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Saurav</td>\r\n			<td>Null</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ankit</td>\r\n			<td>1000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Faizan</td>\r\n			<td>2000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sunil</td>\r\n			<td>3000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kunal</td>\r\n			<td>4000</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>', 'What will be the output for the following queries?\r\nQuery 1. SELECT * FROM EMPLOYEE WHERE Salary <> NULL;\r\nQuery 2. SELECT * FROM EMPLOYEE WHERE Salary = NULL;', NULL, '3', 1, 1, 1, '1630305456tLDrA', '222', '2021-08-30 19:37:36', '2021-08-30 19:37:36'),
(293, 4, NULL, 1, NULL, NULL, 'What is the difference between TRUNCATE, DELETE and DROP? Which of the following statement(s) is/ are correct?\r\n1.	DELETE operation can be rolled back but TRUNCATE and DROP operations cannot be rolled back.\r\n2.	DELETE operation cannot be rolled back but TRUNCATE and DROP operations can be rolled back.\r\n3.	DELETE is an example of DML (Data Manipulation Language) but remaining are the examples of DDL (Data Definition Language).\r\n4.	All are an example of DDL\r\nSelect the correct option:', NULL, '1', 1, 1, 1, '1630305593chXEC', '222', '2021-08-30 19:39:53', '2021-08-30 19:39:54'),
(294, 4, NULL, 1, NULL, '<p><strong>Tables A, B have three columns (namely: &lsquo;id&rsquo;, &lsquo;age&rsquo;, &lsquo;name&rsquo;) each. These tables have no &lsquo;null&rsquo; values and there are 100 records in each of the tables.</strong></p>\r\n\r\n<p><strong>Here are two queries based on these two tables &lsquo;A&rsquo; and &lsquo;B&rsquo;:</strong></p>\r\n\r\n<p>Query1: SELECT A.id FROM A WHERE A.age &gt; ALL (SELECT B.age FROM B WHERE B.name = &#39;Ankit&#39;)</p>\r\n\r\n<p>Query2: SELECT A.id FROM A WHERE A.age &gt; ANY (SELECT B.age FROM B WHERE B.name = &#39;Ankit&#39;)</p>', 'Which of the following statement is correct for the output of each query?', NULL, '3', 1, 1, 1, '16303058143WLwS', '222', '2021-08-30 19:43:34', '2021-08-30 19:43:35'),
(295, 4, NULL, 1, NULL, NULL, 'What is true about the relation (table) in different normal forms (1NF, 2NF, 3NF)?\r\n1.	If a relation satisfies the conditions of 1NF. It will automatically satisfy the conditions of 2NF\r\n2.	If a relation satisfies the conditions of 2NF. It will automatically satisfy the conditions of 1NF\r\n3.	If a relation satisfies the conditions of 3NF. It will automatically satisfy the conditions of 1NF\r\n4.	If a relation satisfies the conditions of 2NF. It will automatically satisfy the conditions of 3NF\r\nSelect the correct option:', NULL, '2', 1, 1, 1, '1630305950MRZ3X', '222', '2021-08-30 19:45:50', '2021-08-30 19:45:50'),
(296, 4, NULL, 1, NULL, NULL, 'Suppose you want to compare three keys (‚ÄòPrimary Key‚Äô, ‚ÄòSuper Key‚Äô and ‚ÄòCandidate Key‚Äô) in a database. Which of the following option(s) is/are correct?\r\n1.	Minimal super key is a candidate key\r\n2.	Only one Candidate Key can be Primary Key\r\n3.	All super keys can be a candidate key\r\n4.	We cannot find ‚ÄúPrimary Key‚Äù from ‚ÄúCandidate Key‚Äù\r\nSelect the correct option:', NULL, '1', 1, 1, 1, '1630306090114NT', '222', '2021-08-30 19:48:10', '2021-08-30 19:48:10'),
