ng centre in the 10th century. By the 13th century, however, Italy had become Europe&rsquo;s leader in silk production and export.&nbsp; Venetian merchants traded extensively in silk and encouraged silk growers to settle in Italy. Even now, silk processed in the province of Como in northern Italy enjoys an esteemed reputation.</p>\r\n\r\n<p>The 19th century and industrialization saw the downfall of the European silk industry. Cheaper Japanese silk, trading which was greatly facilitated by the opening of the Suez Canal, was one of the many factors driving the trend. Then in the 20th century, new manmade fibres, such as nylon, started to be used in what had traditionally been silk products, such as stockings and parachutes. The two world wars, which interrupted the supply of raw material from Japan, also stifled the European silk industry. After the Second World War, Japan&rsquo;s silk production was restored, with improved production and quality of raw silk. Japan was to remain the world&rsquo;s biggest producer of raw silk, and practically the only major exporter of raw silk, until the 1970s. However, in more recent decades, China has gradually recaptured its position as the world&#39;s biggest producer and exporter of raw silk and silk yarn. Today, around 125,000 metric tons of silk are produced in the world, and almost 2/3 of that production takes place in China.</p>', 'Merchants used Silk Road to take silk westward and bring back ........ and precious metals.', NULL, '4', 1, 1, 1, '16311836784d44J', 's7', '2021-09-09 23:34:38', '2021-09-09 23:34:38'),
(386, 4, NULL, 1, NULL, '<p>Follow the directions given below to answer the questions that follow. Your answer to the question below would be</p>\r\n\r\n<p>A, if all three items given in the question are exactly ALIKE.</p>\r\n\r\n<p>B, if only the first and second items are exactly ALIKE.</p>\r\n\r\n<p>C, if only the first and third items are exactly ALIKE.</p>\r\n\r\n<p>D, if only the second and third items are exactly ALIKE.</p>\r\n\r\n<p>E, if all three items are DIFFERENT.</p>', '487-211121, 487-211121, 487-211121', NULL, '1', 1, 1, 1, '1631193625TkBxr', 'ct1', '2021-09-10 02:20:25', '2021-09-10 02:20:25'),
(387, 4, NULL, 1, NULL, '<p>Follow the directions given below to answer the questions that follow. Your answer to the question below would be</p>\r\n\r\n<p>A, if all three items given in the question are exactly ALIKE.</p>\r\n\r\n<p>B, if only the first and second items are exactly ALIKE.</p>\r\n\r\n<p>C, if only the first and third items are exactly ALIKE.</p>\r\n\r\n<p>D, if only the second and third items are exactly ALIKE.</p>\r\n\r\n<p>E, if all three items are DIFFERENT.</p>', 'XXYYZXY, XXYYXZY, XXYYZYX', NULL, '5', 1, 1, 1, '1631193702EY8wB', 'ct1', '2021-09-10 02:21:42', '2021-09-10 02:21:42'),
(388, 4, NULL, 1, NULL, '<p>It&rsquo;s tricky to choose a single marketing article as my favourite, but the one that has had a lasting impression on her is HBR&rsquo;s &lsquo;What Creativity in Marketing Looks Like Today.&rsquo; Mark Bonchek and Cara France do a great job distilling the wisdom of senior marketing executives from dozens of top brands, varying from Old Navy to OpenTable. One of my favourite lines is this one &mdash; &lsquo;People are the new channel. The way to amplify impact is by inspiring creativity in others.&#39;</p>', 'Is the statement consistent?', NULL, '2', 1, 1, 1, '16311937634akRi', 'ct1', '2021-09-10 02:22:43', '2021-09-10 02:22:43'),
(389, 4, NULL, 1, NULL, '<p>For millennia, the coconut has been central to the lives of Polynesian and Asian peoples. In the western world, on the other hand, coconuts have always been exotic and unusual, sometimes rare. The Italian merchant traveller Marco Polo apparently saw coconuts in South Asia in the late 13th century, and among the mid-14th-century travel writings of Sir John Mandeville, there is mƒóntion of &#39;great Notes of Ynde&#39; (great Nuts of India). Today, images of palm-fringed tropical beaches are clich&eacute;s in the west to sell holidays, chocolate bars, fizzy drinks and even romance.<br />\r\n&nbsp;</p>', 'Is the statement consistent?', NULL, '1', 1, 1, 1, '1631193895UzuTq', 'ct1', '2021-09-10 02:24:55', '2021-09-10 02:24:55'),
(390, 4, NULL, 1, NULL, '<p><strong>Passage-1</strong>: Most managers can identify the major trends of the day. But in the course of conducting research in a number of industries and working directly with companies, we have discovered that managers often fail to recognize the less obvious but profound ways these trends are influencing consumers&#39; aspirations, attitudes, and behaviors. This is especially true of trends that managers view as peripheral to their core markets.</p>\r\n\r\n<p><br />\r\n<strong>Passage -2</strong>: Most managers can identify the major trends of the day. But in the course of conducting research in a number of industries and working directly with companies, we have discovered that managers often fail to recognize the less obvious but profound ways these trends are influencing consumers&#39; aspirations, attitudes, and behaviours. This is especially true of trends that managers view as peripheral to their core markets.</p>', 'How many differences are there in the two passages?', NULL, '1', 1, 1, 1, '1631193971ydM2n', 'ct1', '2021-09-10 02:26:11', '2021-09-10 02:26:11'),
