(392, 4, NULL, 1, NULL, '<p>Kane was reviewing a set of reports. There was a total of 50 reports. Among those, 15 were sales estimates, 25 were marketing reports, 10 were sales reports. Each report had 10 pages and he had to upgrade all the reports except for sales reports. Upgrading each page takes 10 minutes.</p>', 'How much time will Kane need to upgrade the assigned reports?', NULL, '1', 1, 1, 1, '1631194224qzzXB', 'ct1', '2021-09-10 02:30:24', '2021-09-10 02:30:24'),
(393, 4, NULL, 1, NULL, '<p>James reserved a hotel room for vacation. His friend Ron called him to tell him that he along with his wife would love to join him. So, James booked an extra room. Later, he had to book more rooms when Rose messaged her that her sister and two close friends would be in the same city for vacation and they&rsquo;d all love to join her. Then James changed his reservation one last time.</p>', 'Select the final number of rooms James booked for the vacation:', NULL, '4', 1, 1, 1, '1631194365plMLW', 'ct1', '2021-09-10 02:32:45', '2021-09-10 02:32:45'),
(394, 4, NULL, 1, NULL, '<p>There are two reports submitted by staff covering some data for 4 employees.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<caption>Report 1</caption>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Employee</p>\r\n			</td>\r\n			<td>New Sales</td>\r\n			<td>Bonus Paid</td>\r\n			<td>YTD Sales</td>\r\n		</tr>\r\n		<tr>\r\n			<td>10</td>\r\n			<td>40</td>\r\n			<td>Yes</td>\r\n			<td>67</td>\r\n		</tr>\r\n		<tr>\r\n			<td>01</td>\r\n			<td>56</td>\r\n			<td>No</td>\r\n			<td>54</td>\r\n		</tr>\r\n		<tr>\r\n			<td>11</td>\r\n			<td>34</td>\r\n			<td>No</td>\r\n			<td>107</td>\r\n		</tr>\r\n		<tr>\r\n			<td>21</td>\r\n			<td>23</td>\r\n			<td>No</td>\r\n			<td>98</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<caption>Report 2</caption>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Employee</p>\r\n			</td>\r\n			<td>New Sales</td>\r\n			<td>Bonus Paid</td>\r\n			<td>YTD Sales</td>\r\n		</tr>\r\n		<tr>\r\n			<td>10</td>\r\n			<td>40</td>\r\n			<td>Yes</td>\r\n			<td>67</td>\r\n		</tr>\r\n		<tr>\r\n			<td>01</td>\r\n			<td>56</td>\r\n			<td>No</td>\r\n			<td>56</td>\r\n		</tr>\r\n		<tr>\r\n			<td>11</td>\r\n			<td>34</td>\r\n			<td>No</td>\r\n			<td>107</td>\r\n		</tr>\r\n		<tr>\r\n			<td>21</td>\r\n			<td>23</td>\r\n			<td>No</td>\r\n			<td>98</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 'Which employee has different information listed between the reports?', NULL, '2', 1, 1, 1, '1631195087rTFdG', 'ct1', '2021-09-10 02:44:47', '2021-09-10 02:44:47'),
(395, 4, NULL, 1, NULL, '<p>You&rsquo;re helping your roommate who had to leave due to an emergency. She has left a voicemail message describing what tasks you have to do for her.<br />\r\n&ldquo;Hey! Thank you so much for helping me. The main thing you need to do is arrange my books on the new shelf. For that, you have to unpack the parcels first. After that, put my clothes in the washing machine. Then water my desk plant. Oh, I forgot to say, eat the pizza I ordered for you before you start doing all these. This is a big help! Thanks again!&rdquo;<br />\r\n&nbsp;</p>', 'What is the right order of the tasks?', NULL, '3', 1, 1, 1, '1631195216EflVD', 'ct1', '2021-09-10 02:46:56', '2021-09-10 02:46:56'),
