(409, 4, NULL, 5, NULL, '<p>Suppose you have been assigned to write a billing function for a mobile company. The billing</p>\r\n\r\n<p>system is as follows-</p>\r\n\r\n<p>00:00 Hours to 06:00 Hours - 1Tk Per Min</p>\r\n\r\n<p>06:00 Hours to 12:00 Hours- 2Tk Per Min</p>\r\n\r\n<p>12:00 Hours to 18:00 Hours- 3Tk Per Min</p>\r\n\r\n<p>18:00 Hours to 00.00 Hours &ndash; 4Tk Per Min</p>\r\n\r\n<p><strong>Input format:</strong></p>\r\n\r\n<p><strong>Start Time:Day::Hour:Minute</strong></p>\r\n\r\n<p><strong>EndTime: Day::Hour:Minute</strong></p>', 'Write code to find the bill of a person who is talking on the mobile phone starting at any time of\r\nthe day and talking for any length of time within a month.', NULL, NULL, 15, 1, 1, '1632056775Rjtdx', 'p1', '2021-09-20 02:06:15', '2021-09-20 02:06:15'),
