(411, 4, NULL, 5, NULL, '<p>Implement the following function for an array of integers: Getfiltered (skip, pageSize,</p>\r\n\r\n<p>PageNumber, sortOrder) Say the array has N elements.</p>\r\n\r\n<p>If skip = K, you have to skip first K elements and paginate next (N-K) elements. K will be less than</p>\r\n\r\n<p>N+1.</p>\r\n\r\n<p>If pageSize = P then Each page will contain exactly P items. P will be within range</p>\r\n\r\n<p>1&lt;=P&lt;=(N-K)</p>\r\n\r\n<p>PageNumber will be within range 1&lt;=PageNumber &lt;= (N-K)</p>\r\n\r\n<p>SortOrder will be 0 or 1.0 means Ascending and 1 means Descending.</p>', 'Write your answer.', NULL, NULL, 15, 1, 1, '1632056892VUA1j', 'p1', '2021-09-20 02:08:12', '2021-09-20 02:08:12'),
