(435, 26, NULL, 5, 'nodejs', '<p>JavaScript, often abbreviated as JS, is a programming language that conforms to the ECMAScript specification. JavaScript is high-level, often just-in-time compiled, and multi-paradigm. It has curly-bracket syntax, dynamic typing, prototype-based object-orientation, and first-class functions.</p>', 'Write \"Javascript\" on Console', NULL, 'console.log(\"Hello\")', 2, 2, 1, '1632133812nWzvQ', '', '2021-09-20 23:30:12', '2021-09-20 23:30:12'),
