(437, 26, NULL, 5, 'php', '<p>PHP is a general-purpose scripting language geared towards web development. It was originally created by Danish-Canadian programmer Rasmus Lerdorf in 1994. The PHP reference implementation is now produced by The PHP Group.</p>', 'Write your Name in php', NULL, '<?php echo \"Hossain\";?>', 2, 2, 1, '1632133927695PA', '', '2021-09-20 23:32:07', '2021-09-20 23:32:07'),
