(446, 4, NULL, 5, NULL, '<p>Suppose you have been assigned to write a billing function for a mobile company. The billing system is as follows-<br />\r\n00:00 Hours to 06:00 Hours - 1Tk Per Min<br />\r\n06:00 Hours to 12:00 Hours- 2Tk Per Min<br />\r\n12:00 Hours to 18:00 Hours- 3Tk Per Min<br />\r\n18:00 Hours to 00.00 Hours &ndash; 4Tk Per Min<br />\r\nInput format:<br />\r\nStart Time:Day::Hour:Minute<br />\r\nEndTime: Day::Hour:Minute<br />\r\n&nbsp;</p>', 'Write code to find the bill of a person who is talking on the mobile phone starting at any time of\r\nthe day and talking for any length of time within a month.', NULL, NULL, 15, 1, 1, '1632206844ByOmx', 'P1', '2021-09-21 19:47:24', '2021-09-21 19:47:24'),
