(448, 4, NULL, 5, NULL, '<p>Implement the following function for an array of integers: Getfiltered (skip, pageSize,<br />\r\nPageNumber, sortOrder) Say the array has N elements.<br />\r\nIf skip = K, you have to skip first K elements and paginate next (N-K) elements. K will be less than<br />\r\nN+1.<br />\r\nIf pageSize = P then Each page will contain exactly P items. P will be within range<br />\r\n1&lt;=P&lt;=(N-K)<br />\r\nPageNumber will be within range 1&lt;=PageNumber &lt;= (N-K)<br />\r\nSortOrder will be 0 or 1.0 means Ascending and 1 means Descending.</p>', 'Write your answer:', NULL, NULL, 15, 1, 1, '16322070040SuqK', 'P1', '2021-09-21 19:50:04', '2021-09-21 19:50:04'),
