(10, 4, 'Verbal Reasoning', 3, 'This test is a psychometric test which measures cognitive ability of job applicants and is a credible mean of intelligence testing.  It evaluates candidate‚Äôs skill in problem-solving based around words and language. Participants who do well in this test have a good understanding and reasoning concepts based around words and language. Consequently, this test will help you assess candidate‚Äôs reasoning ability through language.', NULL, 2, NULL, 3, NULL, NULL, NULL, 2, 0, '1628201435ldKob', '2021-08-06 11:10:35', '2021-08-06 12:33:38'),
(11, 4, 'Verbal Reasoning', 3, 'This test is a psychometric test which measures cognitive ability of job applicants and is a credible mean of intelligence testing.  It evaluates candidate‚Äôs skill in problem-solving based around words and language. Participants who do well in this test have a good understanding and reasoning concepts based around words and language. Consequently, this test will help you assess candidate‚Äôs reasoning ability through language.', NULL, 20, NULL, 3, NULL, NULL, NULL, 20, 1, '1628202251tei6Y', '2021-08-06 11:24:11', '2021-08-06 12:33:06'),
(14, 4, 'Mathematics', 3, 'This math test will assess candidate‚Äôs strength in solving math equations and problems on Number System, Decimals-Fractions, Average, Percentage, Ratio & Proportion, and Profit & Loss. If you want to identify candidates skilled in numbers, this test is the right one.\r\n\r\nCovered skills:\r\n	Number System  		Percentage\r\n	Decimals-Fractions		Ratio & Proportion\r\n	Average			Profit & Loss', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1628248863TiDwI', '2021-08-07 00:21:03', '2021-08-16 04:10:44'),
(15, 5, 'Talent acquisition / Recruitment /', 6, 'The talent acquisition test evaluates candidates\' core competencies in the areas of sourcing and recruiting talent. This test will help you identify candidates who have practical experience in talent acquisition and can help meet your staffing goals.', NULL, 30, NULL, 1, NULL, NULL, NULL, 30, 0, '1628346948C1GT9', '2021-08-08 03:35:48', '2023-01-25 11:35:16'),
