(20, 4, 'Merchandising', 6, 'This test provides a wide range of questions that assess candidates‚Äô in-depth theoretical knowledge required for merchandising positions. With the help of this test, you can make your hire successful and find the perfect fit for the merchandising role.', NULL, 20, NULL, 2, NULL, NULL, NULL, 30, 1, '1628767132Ia6sm', '2021-08-13 00:18:52', '2021-08-16 22:43:38'),
(22, 4, 'Situational Judgement', 5, 'Situational judgment tests tend to determine behavioral tendencies, assessing how an individual will behave in a certain situation, and knowledge instruction, which evaluates the effectiveness of possible responses. Situational judgment tests could also reinforce the status quo with an organization.', NULL, 15, NULL, 2, NULL, NULL, NULL, 15, 1, '1628928242ZYmPV', '2021-08-14 21:04:02', '2021-08-14 21:14:49'),
(23, 4, 'Analytical Reasoning', 5, 'Analytical Reasoning tests tend to determine behavioral tendencies, assessing how an individual will behave in a certain situation, and knowledge instruction, which evaluates the effectiveness of possible responses. Analytical Reasoning tests could also reinforce the status quo with an organization.', NULL, 12, NULL, 2, NULL, NULL, NULL, 20, 1, '1628929032jzgxB', '2021-08-14 21:17:12', '2021-08-14 21:26:37'),
(25, 4, 'Mathematics', 3, 'This is a beginner level test that measures a candidate‚Äôs basic level of skill in computation and applications. This test can be used to identify whether they have a good basic in mathematics.', NULL, 20, NULL, 1, NULL, NULL, NULL, 20, 1, '1629026040O8upF', '2021-08-16 00:14:00', '2021-08-16 04:10:01'),
(26, 4, 'Mathematics', 3, 'This expert-level math test assesses candidates‚Äô in-depth mathematical knowledge. Problems on numbers, percentage, chain rule, area, surface, mixture, probability etc. are included in the test. Therefore, you can say that the candidates having a good score on this test are undoubtedly math experts.', NULL, 20, NULL, 3, NULL, NULL, NULL, 20, 1, '1629028512OxsbN', '2021-08-16 00:55:12', '2021-08-16 04:10:08'),
(27, 4, 'Brand Marketing', 6, 'To choose the right candidate for Brand Marketing, an employer must assess candidates‚Äô practical and theoretical knowledge as well as Analytical skill, understanding of trends, creativity, time & project management skills, communication skills, market research skills. This test will help you to assess candidates‚Äô above-mentioned skills for both traditional and digital marketing.', NULL, 20, NULL, 2, NULL, NULL, NULL, 30, 1, '1629100086IZCZW', '2021-08-16 20:48:06', '2021-08-16 22:01:06'),
(29, 4, 'Verbal Reasoning', 3, 'This test is a psychometric test that measures the cognitive ability of job applicants and is a credible means of intelligence testing. It evaluates candidate‚Äôs skills in problem-solving based on words and language. Participants who do well in this test have a good understanding and reasoning concepts based around words and language. Consequently, this test will help you assess a candidate‚Äôs reasoning ability through language.', NULL, 20, NULL, 1, NULL, NULL, NULL, 20, 1, '16291669148JsrS', '2021-08-17 15:21:54', '2021-08-17 16:07:45'),
(30, 4, 'Verbal Reasoning', 3, 'This intermediate-level verbal reasoning test is a psychometric test that measures the cognitive ability of job applicants and is a credible means of intelligence testing. It evaluates candidate‚Äôs skills in problem-solving based on words and language. Participants who do well in this test have a good understanding and reasoning concepts based around words and language. Consequently, this test will help you assess a candidate‚Äôs reasoning ability through language.\r\nCovered skills:\r\n                        Vocabulary                 Analogy', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1629174893yJDRQ', '2021-08-17 17:34:53', '2021-08-17 18:02:40'),
(31, 4, 'Media Buying, Digital Marketing', 6, 'Digital Marketing has vastly replaced traditional marketing. Moreover, the Covid-19 pandemic has narrowed down the scope of traditional marketing more. It is high time businesses hired Digital Marketing experts as well as trained their present employees to reach their audiences.\r\nEmployers may use this Digital Marketing Test to find out how strong the applicants\' digital marketing abilities are. \r\nEmployers can use this data to make better decisions about training and career development for \r\ntheir present employees.\r\nWhen hiring for digital marketing positions, the exam will assist hiring managers in determining whether individuals are worth advancing to the final phases of the hiring process.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1629191721986uN', '2021-08-17 22:15:21', '2021-08-17 23:29:12'),
(32, 4, 'Reading Comprehension', 4, 'The Reading Comprehension test intends for assessing your candidate\'s English language and comprehension skills. In other words, it measures how well candidates can understand what they read. The questions refer to reading various passages with various lengths. Candidates who perform well in this test have a strong base of comprehension skills.', NULL, 13, NULL, 3, NULL, NULL, NULL, 13, 0, '1629621319OTExk', '2021-08-22 21:35:19', '2021-08-30 17:45:15'),
