(37, 4, 'Graduate Employment Test', 3, 'An aptitude test for graduates demonstrates a job seeker\'s ability to succeed. It indicates the intrinsic ability to perceive, comprehend, think constructively, and solve difficulties. They demonstrate the capacity to communicate, calculate, recognize patterns and think creatively. With the help of this test, you can see how the candidate\'s mind works and how he or she is able to think strategically.', NULL, 60, NULL, 2, NULL, NULL, NULL, 60, 1, '1630411094HDlUX', '2021-09-01 00:58:14', '2021-09-01 01:00:09'),
