(40, 4, 'Reading Comprehension- I', 4, 'Reading comprehension assesses a candidate\'s ability to understand and interpret what they read. Those who performs well in this test are able to understand what they read, relate what they read and what they already know, and think deeply about what they read.', NULL, 20, NULL, 3, NULL, NULL, NULL, 13, 1, '163118010293046', '2021-09-09 22:35:02', '2021-09-12 17:43:15'),
