(45, 4, 'Competitive Programming Test', 7, 'When it comes to computer interactions, coding languages, problem-solving, analytical thinking, and detail-oriented work, a programming assessment is an important means for having a precise idea about programmers‚Äô skills. Programmers are responsible for the conception, development, and maintenance of software programs used in various computing applications. Therefore, a programmer must be both creative and analytical in their thinking, as well as adept at writing code and conducting tests for internal software applications.\r\nThis test assesses the programmers against these skills so that you can choose the expert one for your organisation.', NULL, 360, NULL, 2, NULL, NULL, NULL, 100, 0, '1632057857pbKC2', '2021-09-20 02:24:17', '2021-09-21 19:58:06'),
(47, 4, 'MS Excel', 8, 'This Microsoft Excel skill test is specifically designed to assess an applicant\'s level of knowledge of the software and their competency with functions, formulas, sorting and filtering data and data visualization. With this test, you can choose the best candidate with the skills of organizing, analyzing, calculating and visualizing data.', NULL, 20, NULL, 3, NULL, NULL, NULL, 20, 1, '1632115934BYwpM', '2021-09-20 18:32:14', '2021-09-20 18:34:49'),
