(123, 4, 'Digital Marketing', 6, 'Digital marketing, also called online marketing, is the promotion of brands to connect with potential customers using the internet and other forms of digital communication. This includes not only email, social media, and web-based advertising, but also text and multimedia messages as a marketing channel. Essentially, if a marketing campaign involves digital communication, it\'s digital marketing.', NULL, 10, NULL, 2, NULL, NULL, NULL, 10, 1, '1674621114tdyLE', '2023-01-25 10:31:54', '2023-01-25 10:47:00'),
(124, 4, 'Talent Acquisition', 6, 'Talent acquisition is the process of identifying organizational staffing needs, recruiting qualified candidates and selecting the candidates best suited for the available positions', NULL, 20, NULL, 1, NULL, NULL, NULL, 20, 1, '1674623473uobGr', '2023-01-25 11:11:13', '2023-01-25 11:59:28'),
(125, 4, 'Critical Thinking', 3, 'Critical thinking is the process of objectively analyzing information and making rational and informed decisions. It involves the ability to analyze and evaluate information, ideas, and arguments in order to form a well-supported judgment or conclusion. It also involves the ability to identify and evaluate evidence and arguments, as well as recognizing and overcoming biases and prejudices.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674627676gmAtk', '2023-01-25 12:21:16', '2023-01-25 13:02:51'),
(127, 4, 'Customer Support', 6, 'Customer support refers to the services and assistance provided by a company to its customers. This can include answering questions, resolving issues or problems, and providing information or guidance. It can be provided in various forms such as phone support, email support, live chat, and social media support. The goal of customer support is to ensure customer satisfaction and resolve any issues or problems they may have with a company\'s products or services.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '16746373442VEWZ', '2023-01-25 15:02:24', '2023-01-25 16:07:46'),
(129, 4, 'Account/Sales Manager', 6, 'An account manager is an employee who is responsible for developing and maintaining customer relationships that promote satisfaction and retention.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '16746430845hjkt', '2023-01-25 16:38:04', '2023-01-25 17:47:51'),
(131, 4, 'Marketing Executive', 6, 'A marketing executive is a professional who is responsible for the development and implementation of marketing strategies for a company or organization. This can include tasks such as market research, product development, advertising, and public relations. The goal of a marketing executive is to increase sales and revenue for the company by effectively promoting and positioning its products or services. They typically report to a senior marketing or advertising executive or a CEO.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674647757Ewnty', '2023-01-25 17:55:57', '2023-01-25 20:08:18'),
(132, 4, 'Google Adds', 6, 'Google Ads, formerly known as Google AdWords, is a platform developed by Google where businesses and organizations can create and run online advertising campaigns. The platform allows users to create ads, set budgets, and target specific audiences by keywords, location, and other criteria. The ads can appear on Google search results pages, as well as on websites that are part of the Google Display Network, which includes millions of websites and apps. Google Ads also includes a variety of tools to measure the performance of advertising campaigns, including data on click-through rates, conversions, and ad spend.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674654090bDXz9', '2023-01-25 19:41:30', '2023-01-25 20:04:01'),
(133, 4, 'Negotiation', 3, 'Negotiation is a process in which two or more parties, with different needs, interests or goals, attempt to reach a mutually acceptable agreement by communicating and making concessions. Negotiations can take place in various settings, such as business, politics, or personal relationships, and can involve a wide range of issues, such as price, terms, conditions, or the resolution of conflicts. The goal of negotiation is typically to find a solution that benefits all parties involved, although in some cases one party may have more power or leverage than the other, leading to a less equitable outcome. Effective negotiation requires strong communication, active listening, and the ability to understand and address the needs and interests of all parties involved.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674656264DNncI', '2023-01-25 20:17:44', '2023-01-25 21:05:01'),
(134, 4, 'Numerical Reasoning', 6, 'Numerical reasoning, also known as quantitative reasoning or mathematical reasoning, is the ability to understand and analyze numerical information and solve mathematical problems. It involves skills such as mathematical computation, data interpretation, and problem-solving. Numerical reasoning tests are often used as part of aptitude tests and job selection processes to assess a candidate\'s ability to work with numbers and make logical decisions based on numerical data. It can be used in a variety of fields such as finance, engineering, science, and business.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674659532RwQ6T', '2023-01-25 21:12:12', '2023-01-25 21:33:53'),
(135, 4, 'Problem Solving', 3, 'Problem solving refers to the process of identifying, analyzing, and resolving problems or challenges in a logical and systematic manner. It involves several steps, including identifying the problem, developing a plan, implementing a solution, and evaluating the outcome. Problem solving can be applied to various situations and contexts, such as personal, professional, and organizational. In order to be effective at problem solving, individuals need to possess a range of skills, including critical thinking, creativity, and decision-making. Additionally, different problem-solving approaches and tools can be used depending on the specific situation and the type of problem that needs to be solved.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674662139KlfHR', '2023-01-25 21:55:39', '2023-01-25 22:15:45'),
(136, 4, 'Swedish Language', 4, 'Swedish is an Indo-European language belonging to the North Germanic branch of the Germanic languages. In the established classification, it belongs to the East Scandinavian languages, together with Danish, separating it from the West Scandinavian languages, consisting of Faroese, Icelandic, and Norwegian.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674669219P6Faf', '2023-01-25 23:53:39', '2023-01-26 00:39:07'),
(137, 4, 'Polish Language', 4, 'Polish is a Slavic language spoken primarily in Poland. It is the second most widely spoken Slavic language, after Russian. Polish is a synthetic, inflectional language, which means that the grammatical function of words is indicated by changes in their form, rather than by using auxiliary words. It has seven cases for nouns, adjectives, and pronouns, as well as three tenses and three moods for verbs.\r\n\r\nPolish uses the Latin alphabet, but it has a few additional characters, such as the nasal vowels ƒÖ and ƒô, and the diacritical marks (such as the acute accent and the dot above the letter).\r\n\r\nPolish has a rich vocabulary, with many loanwords from Latin, German, and other languages. It also has a complex grammar system with many irregular verbs and noun declensions.\r\n\r\nPolish is spoken by around 50 million people in Poland and by significant communities in other countries such as Ukraine, Belarus, Lithuania, Czech Republic, Slovakia, and many other countries.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674706282Hem49', '2023-01-26 10:11:22', '2023-01-26 10:35:58'),
(138, 4, 'Norwegian Language', 4, 'Norwegian is a Germanic language spoken primarily in Norway, where it is the official language. It is also spoken by communities in Denmark, Sweden, and other countries. There are two official written forms of Norwegian: Bokm√•l and Nynorsk. Bokm√•l is based on the spoken language of the capital city of Oslo and the surrounding area, while Nynorsk is based on rural spoken language. Both forms are used in schools and in official documents, but Bokm√•l is more commonly used. Norwegian is closely related to other Germanic languages such as Danish and Swedish, and speakers of those languages can usually understand written Norwegian.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674712887m9hFf', '2023-01-26 12:01:27', '2023-01-26 12:27:28'),
(139, 4, 'French Language', 4, 'French is a Romance language that originated in France and is now spoken worldwide, including in Canada, Belgium, Switzerland, Haiti, and many African and Caribbean countries. It is also an official language in several international organizations such as the United Nations, the European Union, and the Olympic Committee. French is a phonetic language, meaning that it is pronounced as it is written, making it relatively easy to learn for speakers of other Romance languages. French vocabulary is heavily influenced by Latin, and it also includes many words borrowed from other languages such as Germanic, Celtic, and Greek languages. French is also known for its complex grammar rules, including the use of verb conjugations and noun genders. French is widely taught as a second language and is considered to be one of the most important languages in business, diplomacy, and culture.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674716535C9Ii3', '2023-01-26 13:02:15', '2023-01-26 13:24:20'),
(140, 4, 'German Language', 4, 'German is a West Germanic language spoken primarily in Germany, Austria, and Switzerland, as well as in other parts of Europe. It is the official language of Germany and is the second most widely spoken Germanic language in Europe after English. German is also a co-official language in several other countries including Belgium, Luxembourg, and Liechtenstein. The German language is written using the Latin script and has a complex grammar system, including cases and gender for nouns. It also has a strong influence from Latin and Greek vocabulary. German has a rich literary tradition and is known for authors such as Goethe, Schiller, and Kafka. It is also an important language for science, technology, and business.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674742084KKAKV', '2023-01-26 20:08:04', '2023-01-26 20:40:01'),
(141, 4, 'Mandarin Language', 4, 'Mandarin is a Chinese language spoken primarily in China and Taiwan, and is the official language of both countries. It is also one of the four official languages of Singapore. Mandarin is a tonal language, meaning that the tone of a syllable can change the meaning of a word. It is based on the Beijing dialect, and is written in simplified Chinese characters. It is the most widely spoken language in the world, with over one billion speakers.', NULL, 0, NULL, 2, NULL, NULL, NULL, 0, 0, '1674745485Ixa1t', '2023-01-26 21:04:45', '2023-01-26 22:52:08'),
(142, 4, 'Mandarin Language', 4, 'Mandarin is a Chinese language spoken primarily in China and Taiwan, and is the official language of both countries. It is also one of the four official languages of Singapore. Mandarin is a tonal language, meaning that the tone of a syllable can change the meaning of a word. It is based on the Beijing dialect, and is written in simplified Chinese characters. It is the most widely spoken language in the world, with over one billion speakers.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674751986EmrUC', '2023-01-26 22:53:06', '2023-01-26 23:21:01'),
(143, 4, 'Spanish Language', 4, 'Spanish, also known as Castilian, is a Romance language that originated in the Iberian Peninsula. It is the official language in Spain and most of Latin America, as well as in several other countries such as Equatorial Guinea and the Philippines. Spanish is also one of the six official languages of the United Nations. The language is written using the Latin alphabet and has approximately 460 million native speakers worldwide. Spanish has a rich vocabulary with many loanwords from Arabic, Italian, and other languages. It is known for its clear, distinct pronunciation and its use of the subjunctive mood.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674756106sytCH', '2023-01-27 00:01:46', '2023-01-27 00:26:53'),
(144, 4, 'Italian Language', 4, 'Italian is a Romance language spoken primarily in Italy, Switzerland, San Marino, and Vatican City. It is the official language of Italy and also one of the official languages of Switzerland. Italian is closely related to other Romance languages such as Spanish, Portuguese, and French and is derived from the Vulgar Latin spoken by the Roman Empire. It is a synthetic language, meaning that words are formed by combining prefixes, roots, and suffixes. The language is known for its musicality and is often used in opera and other forms of music. It is written in the Latin script and has a complex system of verb conjugation and noun declensions.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674758859nXWHp', '2023-01-27 00:47:39', '2023-01-27 01:11:04'),
(145, 4, 'Portuguese language', 4, 'Portuguese is a Romance language that originated in what is now Galicia and northern Portugal. It is the official language of Portugal, Brazil, Angola, Mozambique, and other countries. Portuguese is closely related to Spanish and is considered a Romance language. It is written in the Latin alphabet and has many grammatical and lexical similarities with Spanish, but there are also some significant differences. Portuguese is known for its melodic intonation and its rich vocabulary, which includes many words of Arabic, African and indigenous American origin.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674760962Onv6B', '2023-01-27 01:22:42', '2023-01-27 01:55:16'),
(146, 4, 'Japanese Language', 4, 'Japanese is the official language of Japan and is spoken by over 125 million people worldwide. It is a member of the Japonic language family, which also includes the Ryukyuan languages spoken in the Ryukyu Islands.\r\n\r\nJapanese has three writing systems: hiragana, katakana, and kanji. Hiragana and katakana are syllabic scripts, with each character representing a sound or syllable. Kanji, on the other hand, are ideographic characters borrowed from Chinese, each with a specific meaning. Japanese writing often uses a combination of all three scripts, with kanji used for the main content, hiragana used for grammatical particles and inflections, and katakana used for foreign words and onomatopoeia.\r\n\r\nJapanese grammar is relatively simple, with relatively free word order and a small number of inflections. However, it has a complex honorifics system, with different levels of politeness and formality used depending on the context and the relationship between the speaker and the listener.\r\n\r\nJapanese culture and society have also influenced the language, with many loanwords from Chinese and English, as well as a rich vocabulary for expressing emotions and concepts specific to Japan.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674763825xd5HL', '2023-01-27 02:10:25', '2023-01-27 02:32:42'),
(147, 4, 'Dutch Language', 4, 'Dutch is a Germanic language that is spoken primarily in the Netherlands, Belgium, and Suriname. It is also spoken as a second language in other countries, such as Indonesia and South Africa. Dutch is a West Germanic language and is closely related to other Germanic languages such as English, German, and Frisian.\r\n\r\nDutch has three main dialects: Hollandic, Brabantic and Limburgish, which are spoken in different regions of the Netherlands. Standard Dutch is based on the Hollandic dialect, which is spoken in the Netherlands\' western provinces.\r\n\r\nThe Dutch language has many loanwords from French, Latin and Greek, and has also borrowed words from other languages such as English, German, and Spanish. Dutch uses a lot of compound nouns and is known for its complex grammar.\r\n\r\nDutch is an inflected language and has a complex system of noun declensions, verb conjugations and adjective declensions. Dutch is also known for its use of separable verbs, which are made up of a particle and a verb. These separable verbs are used in many idiomatic expressions and are a key feature of the Dutch language.\r\n\r\nIn the Netherlands, Dutch is the official language and is used in government, education, and the media. In Belgium, Dutch is one of the official languages, along with French and German, and is spoken mainly in the northern regions of the country.', NULL, 21, NULL, 2, NULL, NULL, NULL, 21, 1, '1674766557CHIWw', '2023-01-27 02:55:57', '2023-01-27 03:21:12'),
(148, 4, 'SQL', 7, 'SQL (Structured Query Language) is a programming language used for managing and manipulating relational databases. It is used for inserting, updating, and querying data in a database. SQL commands include SELECT, INSERT, UPDATE, DELETE, and more. SQL is the standard language for relational database management systems such as MySQL, Oracle, and Microsoft SQL Server.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '16747943305ATUn', '2023-01-27 10:38:50', '2023-01-27 11:04:11'),
(149, 4, 'Flutter', 7, 'Flutter is an open-source mobile application development framework created by Google. It is used to develop applications for Android, iOS, Linux, Mac, Windows, and the web. Flutter uses the Dart programming language and utilizes a reactive programming model for building user interfaces. It is known for its fast development cycle and ability to create high-performance, visually attractive apps.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674796976eulTv', '2023-01-27 11:22:56', '2023-01-27 11:45:00'),
(150, 4, 'Salesforce CRM', 6, 'Salesforce CRM (Customer Relationship Management) is a cloud-based software platform that helps businesses manage and automate various sales, marketing, and customer service processes. It provides tools for managing customer data, tracking interactions and communication, automating tasks, and analyzing performance. Salesforce CRM is widely used by businesses of all sizes to streamline their operations and improve customer satisfaction.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674798828Z8Gt8', '2023-01-27 11:53:48', '2023-01-27 14:03:06'),
(151, 4, 'Leadership', 3, 'Leadership is the ability to guide, motivate, and influence a group of people to achieve a common goal or set of goals. It involves setting direction, creating a vision, and inspiring others to work together to achieve success. Leadership can be exercised by individuals or groups, and it can take many forms, including formal or informal, positive or negative, and visionary or transactional.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674800376VOcHn', '2023-01-27 12:19:36', '2023-01-27 12:38:09'),
(152, 4, 'Attention to detail', 3, 'Attention to detail refers to the ability to carefully and thoroughly examine something, often with the intention of identifying and correcting errors or inconsistencies. It can also refer to the ability to pay close attention to small details and nuances in a task or situation. In a work setting, attention to detail is often considered an important skill for many jobs, particularly those that involve critical thinking, problem solving, and accuracy.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '16748829640zkj2', '2023-01-28 11:16:04', '2023-01-28 11:42:11'),
(153, 5, 'Talent Acquisition', 3, 'Test for Talent Acquisition', NULL, 3, NULL, 2, NULL, NULL, NULL, 3, 1, '1674900575linyy', '2023-01-28 16:09:35', '2023-01-28 16:10:54'),
(154, 5, 'eee', 1, 'ee', NULL, 0, NULL, 2, NULL, NULL, NULL, 0, 0, '1674901990nwl7r', '2023-01-28 16:33:10', '2023-01-29 23:36:41'),
(155, 4, 'Sales Management', 3, 'Sales management is the process of overseeing and directing the sales of a company\'s products or services. This includes setting sales goals, analyzing data, assigning sales territories, and overseeing the training and performance of sales representatives. Sales management also involves creating and implementing strategies for increasing sales and achieving the overall goals of the company.', NULL, 0, NULL, 2, NULL, NULL, NULL, 0, 0, '1674966424fU6IJ', '2023-01-29 10:27:04', '2023-01-29 11:14:26'),
(156, 4, 'Sales Management', 3, 'Sales management is the process of developing and implementing strategies and tactics to effectively sell a product or service. This includes tasks such as setting sales goals, creating sales plans, managing a sales team, analyzing sales data, and implementing sales techniques to increase revenue. Sales management also involves identifying and targeting potential customers, developing relationships with clients, and continuously monitoring and adjusting sales strategies to improve performance. Overall, sales management is a crucial aspect of any business, as it is responsible for driving revenue growth and achieving sales targets.', NULL, 20, NULL, 2, NULL, NULL, NULL, 20, 1, '1674970404XsmK8', '2023-01-29 11:33:24', '2023-01-29 12:23:08'),
(157, 4, 'Analytical reasoning', 3, 'Analytical reasoning is a cognitive process that involves breaking down complex information, problems, or situations into smaller, manageable parts to better understand them. It involves using logical thinking, critical analysis, and problem-solving skills to evaluate available data, identify patterns, and make informed decisions. The goal of analytical reasoning is to arrive at a conclusion based on evidence and sound logic, rather than intuition or guesswork. This skill is widely used in a variety of fields, including mathematics, science, business, law, and more, where the ability to analyze and make decisions based on data and information is essential. Effective analytical reasoning requires clear, concise thinking and the ability to identify and evaluate multiple perspectives, weigh the pros and cons of different options, and come to a well-reasoned conclusion.', NULL, 10, NULL, 2, NULL, NULL, NULL, 10, 1, '1674999319NLTSw', '2023-01-29 19:35:19', '2023-01-29 20:01:53'),
(158, 4, 'English Language', 4, 'English grammar is the set of rules for how words are combined to form phrases, clauses, and sentences in the English language. It includes rules for word order, subject-verb agreement, verb tense, adjective and adverb usage, punctuation, and more. English grammar allows speakers to effectively communicate meaning and convey their thoughts and ideas. Effective use of grammar is a crucial component of clear and effective communication in English.', NULL, 5, NULL, 2, NULL, NULL, NULL, 5, 1, '1675001186FTihF', '2023-01-29 20:06:26', '2023-01-29 20:13:23'),
(159, 4, 'Numerical Reasoning', 3, 'Numerical reasoning is the ability to understand and analyze mathematical concepts and relationships and apply mathematical methods to solve problems. It involves interpreting and manipulating numerical information, making estimates, and using mathematical operations to reach conclusions based on data. This skill is essential for many careers, including finance, engineering, science, and technology, where problem-solving and decision-making often rely on a strong understanding of numbers and mathematical principles. Numerical reasoning requires attention to detail, strong mental arithmetic skills, and the ability to think logically and systematically.', NULL, 10, NULL, 3, NULL, NULL, NULL, 10, 1, '1675001773fuxNC', '2023-01-29 20:16:13', '2023-01-29 20:30:46'),
(160, 4, 'Situational analytics/Business strategy', 5, 'Situational analysis or situational assessment refers to the process of analyzing the current situation or environment of a business, organization, or industry in order to inform and guide decision-making and strategy development.\r\n\r\nBusiness strategy refers to the long-term plan of action for achieving specific goals and objectives within a business environment. It encompasses the overall approach to achieving success, including market positioning, product offerings, customer engagement, resource allocation, and operational processes.\r\n\r\nSituational analysis is an important component of business strategy as it provides critical information and insights into the current state of the business and its environment, which helps in formulating effective and realistic strategies for the future. The outcome of a situational analysis should inform and guide the development of business strategies that take into account the current and future market conditions, competitors, customer needs, and organizational capabilities.', NULL, 35, NULL, 2, NULL, NULL, NULL, 30, 1, '1675008556XS4bI', '2023-01-29 22:09:16', '2023-01-29 23:13:13'),
